import React from "react";
import { useDispatch, useSelector } from "react-redux";

const Profile = (props) => {
  const dispatch = useDispatch();
  const isLoggedIn = useSelector((state) => state.isLoggedIn);

  return (
    <React.Fragment>
      <button>Log In!</button>
    </React.Fragment>
  );
};

export default Profile;
